import React from 'react';
import { gql, useQuery } from '@apollo/client';

const getBooksQuery = gql`
    {
        books {
            name
            id
        }
    }
`

export const BookList = () => {
    const {loading, error, data} = useQuery(getBooksQuery);
    return (
      <div>
        <ul id="book-list">
            <li>Book name</li>
        </ul>
      </div>
    );
}
